import{
  BrowserRouter as Router,
  Switch,
  Route,

} from "react-router-dom";


function App() {

  return (
    <Router>
    <Topbar/>
   <Switch>
      <Route path="/">
        <Home/>
      </Route>
      <Route path="/register">
       <Register/>
      </Route>
   </Switch>

    </Router>
  );
}

export default App;
